Chordizer.F=function(b,a){this.addChord(b,"F",1,a).addBarre(1,"LowE","HighE").addFretPress(2,"G").addFretPress(3,["A","D"])};Chordizer.Fm=function(b,a){this.addChord(b,"Fm",1,a).addBarre(1,"LowE","HighE").addFretPress(3,["A","D"])};Chordizer.Fis=function(b,a){this.addChord(b,"F#",2,a).addBarre(1,"LowE","HighE").addFretPress(2,"G").addFretPress(3,["A","D"])};Chordizer.Fism=function(b,a){this.addChord(b,"F#m",2,a).addBarre(1,"LowE","HighE").addFretPress(3,["A","D"])};